// ==UserScript==
// @name         Amazon Item Availability Notifier
// @namespace    mchenzero
// @version      1.0
// @description  Alarm you when an Amazon item is available.
// @author       Martin Chen
// @match        *://www.amazon.de/*
// @match        *://www.amazon.fr/*
// @match        *://www.amazon.ca/*
// @match        *://www.amazon.com/*
// @match        *://www.amazon.com.mx/*
// @match        *://www.amazon.co.jp/*
// @match        *://www.amazon.es/*
// @match        *://www.amazon.it/*
// @match        *://www.amazon.in/*
// @match        *://www.amazon.co.uk/*
// @match        *://www.amazon.cn/*
// @grant        none
// @downloadURL https://update.greasyfork.org/scripts/28023/Amazon%20Item%20Availability%20Notifier.user.js
// @updateURL https://update.greasyfork.org/scripts/28023/Amazon%20Item%20Availability%20Notifier.meta.js
// ==/UserScript==

(function() {
    'use strict';

    const ALARM_AUDIO_URL = 'data:audio/mp3;base64,';

    class AmazonItemAvailabilityNotifier {
        static setup() {
            const aiac = new AmazonItemAvailabilityNotifier();

            if (!aiac.isAmazonItemPage()) return;

            aiac.loadStates();

            if (aiac.lastRefresh) {
                aiac.addLastRefreshToPageTitle();
                delete aiac.lastRefresh;
                aiac.saveStates();
            }

            aiac.checkPrice();

            aiac.attachUi();

            return aiac;
        }

        loadStates() {
            const itemId = this.getAmazonItemId();
            const storageKey = `aiac-${itemId.toLowerCase()}`;
            const rawSavedStates = localStorage.getItem(storageKey);
            if (rawSavedStates) {
                const savedStates = JSON.parse(rawSavedStates);
                this.options = savedStates.options || {};
                if (savedStates.lastRefresh) {
                    this.lastRefresh = savedStates.lastRefresh;
                }
            } else {
                this.options = {};
            }
            return this;
        }

        saveStates() {
            const itemId = this.getAmazonItemId();
            const storageKey = `aiac-${itemId.toLowerCase()}`;
            const states = { options: this.options, lastRefresh: this.lastRefresh };
            localStorage.setItem(storageKey, JSON.stringify(states));
            return this;
        }

        setOption(name, value) {
            if (!this.options) this.options = {};
            this.options[name] = value;
            this.saveStates();
            this.checkPrice();
            return this;
        }

        deleteOption(name) {
            if (this.options && this.options.hasOwnProperty(name)) {
                delete this.options[name];
                this.saveStates();
                this.checkPrice();
            }
            return this;
        }

        checkPrice() {
            const priceLow = this.options.hasOwnProperty('priceLow') ? this.options.priceLow : 0;
            const priceHigh = this.options.hasOwnProperty('priceHigh') ? this.options.priceHigh : Number.MAX_VALUE;
            const price = this.getAmazonItemPrice();

            if (price >= priceLow && price <= priceHigh && this.options.alarm) {
                this.disableRefresh().startAlarm();
            } else {
                this.stopAlarm();
                if (this.options.refresh) {
                    this.enableRefresh();
                } else {
                    this.disableRefresh();
                }
            }
        }

        attachUi() {
            if (this._uiAttached) return;

            this._uiStylesheet = document.createElement('style');
            this._uiStylesheet.innerHTML = `
                .aiac-container {
                    float: right;
                }

                .aiac-container label {
                    display: initial;
                    padding: 0;
                }

                .aiac-row {
                    margin: 5px auto;
                }

                .aiac-flex {
                    display: flex;
                    justify-content: space-between;
                }

                .aiac-opt-price-low, .aiac-opt-price-high {
                    width: 47px;
                    height: 24px !important;
                    padding: 3px 5px !important;
                }
            `;

            this._uiContainer = document.createElement('div');
            this._uiContainer.classList.add('aiac-container');
            this._uiContainer.innerHTML = `
                <div class="aiac-row">
                    <label>Price</label>
                    <input type="text" class="aiac-opt-price-low">
                    -
                    <input type="text" class="aiac-opt-price-high">
                </div>
                <div class="aiac-row aiac-flex">
                    <label>
                        <input type="checkbox" class="aiac-opt-refresh">
                        Refresh
                    </label>
                    <label>
                        <input type="checkbox" class="aiac-opt-alarm">
                        Alarm
                    </label>
                </div>
            `;

            const tbPriceLow = this._uiContainer.querySelector('.aiac-opt-price-low');
            const tbPriceHigh = this._uiContainer.querySelector('.aiac-opt-price-high');
            const cbRefresh = this._uiContainer.querySelector('.aiac-opt-refresh');
            const cbAlarm = this._uiContainer.querySelector('.aiac-opt-alarm');

            tbPriceLow.value = this.options.hasOwnProperty('priceLow') ? this.options.priceLow : '0';
            tbPriceHigh.value = this.options.hasOwnProperty('priceHigh') ? this.options.priceHigh : '';
            cbRefresh.checked = !!this.options.refresh;
            cbAlarm.checked = !!this.options.alarm;

            tbPriceLow.addEventListener('input', event => {
                const value = parseFloat(tbPriceLow.value);
                if (!Number.isNaN(value)) {
                    this.setOption('priceLow', value);
                } else if (tbPriceLow.value === '') {
                    this.deleteOption('priceLow');
                }
            });

            tbPriceHigh.addEventListener('input', event => {
                const value = parseFloat(tbPriceHigh.value);
                if (!Number.isNaN(value)) {
                    this.setOption('priceHigh', value);
                } else if (tbPriceHigh.value === '') {
                    this.deleteOption('priceHigh');
                }
            });

            cbRefresh.addEventListener('change', event => {
                this.setOption('refresh', cbRefresh.checked);
            });

            cbAlarm.addEventListener('change', event => {
                this.setOption('alarm', cbAlarm.checked);
            });

            const parent = document.querySelector('#centerCol');
            parent.insertBefore(this._uiContainer, parent.firstChild);
            parent.insertBefore(this._uiStylesheet, parent.firstChild);

            this._uiAttached = true;

            return this;
        }

        startAlarm() {
            return this.flashPageTitle().playAlarmAudio();
        }

        stopAlarm() {
            return this.stopFlashingPageTitle().stopAlarmAudio();
        }

        enableRefresh() {
            if (!this._refreshTimer) {
                this._refreshTimer = setTimeout(() => {
                    delete this._refreshTimer;
                    this.lastRefresh = Date.now();
                    this.saveStates();
                    document.location.reload();
                }, 30000);
            }
            return this;
        }

        disableRefresh() {
            if (this._refreshTimer) {
                clearTimeout(this._refreshTimer);
                delete this._refreshTimer;
            }
            return this;
        }

        flashPageTitle() {
            if (!this._flashTimer) {
                this._documentTitle = document.title;
                this._flashTimer = setInterval(() => {
                    document.title = document.title ? '' : this._documentTitle;
                }, 300);
            }
            return this;
        }

        stopFlashingPageTitle() {
            if (this._flashTimer) {
                clearInterval(this._flashTimer);
                document.title = this._documentTitle;
                delete this._flashTimer;
                delete this._documentTitle;
            }
            return this;
        }

        playAlarmAudio() {
            if (!this._audio) {
                this._audio = new Audio(ALARM_AUDIO_URL);
                this._audio.loop = true;
                this._audio.play();
            }
            return this;
        }

        stopAlarmAudio() {
            if (this._audio) {
                this._audio.pause();
                delete this._audio;
            }
            return this;
        }

        addLastRefreshToPageTitle() {
            if (this.lastRefresh) {
                const d = new Date(this.lastRefresh);
                const h = d.getHours();
                const m = d.getMinutes();
                const hh = ('00' + h).slice(-2);
                const mm = ('00' + m).slice(-2);
                document.title = `[${hh}:${mm}] ${document.title}`;
            }
            return this;
        }

        isAmazonItemPage() {
            return !!document.querySelector('#dp-container');
        }

        getAmazonItemId() {
            return document.querySelector('#ASIN').value;
        }

        getAmazonItemPrice() {
            const ourPriceElement = document.querySelector('#priceblock_ourprice');
            const dealPriceElement = document.querySelector('#priceblock_dealprice');

            if (ourPriceElement) {
                return this.parsePrice(ourPriceElement.textContent);
            } else if (dealPriceElement) {
                return this.parsePrice(dealPriceElement.textContent);
            } else {
                return -1;
            }
        }

        parsePrice(text) {
            return Number(text.replace(/[^\d,.]/g, '').replace(/,(\d{2})$/, '.$1').replace(/,/g, ''));
        }
    }

    AmazonItemAvailabilityNotifier.setup();
})();
